def show_main_loop():
    """Print Main Pipe Loop"""

    for y in range(len(metal_map)):
        for x in range(len(metal_map[0])):
            for key, values in steps.items():
                if (x,y) in values:
                    break
            if key==-1:
                print('.',end="")
            else:
                print(metal_map[y][x],end="")
        
        print()


